import React from "react";
import styles from "./Button.module.scss";
import cn from "classnames";

const Button = ({ children, click, success }) => {
  return (
    <button
      onClick={() => click && click()}
      className={cn(styles.btn, {
        [styles.btn_success]: success,
      })}
    >
      {" "}
      {children}{" "}
    </button>
  );
};
export default Button;
